INSERT INTO `front_cms_home` (`id`, `title`, `subtitle`, `item_type`, `description`, `elements`, `color1`, `color2`, `branch_id`, `active`) VALUES
(1, 'Chief Secretary Initiative to transform GB Public Sector Schools into Smart Schools', 'Learning Managment System &#40;LMS&#41; in Government Schools of GB', 'wellcome', 'The Chief Secretary of Gilgit-Baltistan (GB) has embarked on a transformative initiative to modernize the region\'s public sector schools, aiming to turn them into cutting-edge smart schools. This visionary project involves equipping students with Chromebooks, providing them with access to state-of-the-art technology and digital resources. Additionally, a robust Learning Management System &#40;LMS&#41; has been implemented, allowing teachers and students to seamlessly collaborate, access educational materials, and track progress. By integrating technology and enhancing digital learning experiences, this initiative seeks to empower the youth of GB with the tools and skills necessary to thrive in the modern world, thus fostering educational excellence and innovation in the region.', '{\"image\":\"wellcome1.jpg\"}', '#000', NULL, 1, 1),
(2, 'Experience Teachers Team', NULL, 'teachers', 'Making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident.', '{\"teacher_start\":\"0\",\"image\":\"featured-parallax1.jpg\"}', '#fff', '#fff', 1, 0),
(3, 'Mesh Technologies Joint Venture A&Z Consultants', NULL, 'services', 'The project of Transformation of 50 Schools into Smart Schools has been executed by Joint Venture of Mesh Technologies & A&Z Consultants', '', '#000', '#fff', 1, 1),
