top:18.5pt;width:3in;height:67.5pt;z-index:251658240;\r\n visibility:visible;mso-wrap-style:square;mso-width-percent:0;\r\n mso-height-percent:0;mso-wrap-distance-left:9pt;mso-wrap-distance-top:0;\r\n mso-wrap-distance-right:9pt;mso-wrap-distance-bottom:0;\r\n mso-position-horizontal:absolute;mso-position-horizontal-relative:text;\r\n mso-position-vertical:absolute;mso-position-vertical-relative:text;\r\n mso-width-percent:0;mso-height-percent:0;mso-width-relative:page;\r\n mso-height-relative:page\'>\r\n <v:imagedata src=\"file:///C:/Users/user/AppData/Local/Temp/msohtmlclip1/01/clip_image003.png\"\r\n  o:title=\"\"></v:imagedata>\r\n <w:wrap type=\"through\"></w:wrap>\r\n</v:shape><![endif]--><!--[if !vml]--><!--[endif]--><span style=\"font-size:9.0pt;line-height:107%\"><o:p></o:p></span></p><p class=\"MsoNormal\"><o:p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<img src=\"data:image/png;base64,\" alt=\"\" style=\"width: 293.968px; height: 91.4467px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</o:p><img src=\"data:image/png;base64,\" alt=\"\" style=\"width: 373.113px; height: 101.97px;\"></p><p class=\"MsoNormal\"><o:p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</o:p><span style=\"font-size: 9pt; line-height: 107%; font-family: Tahoma, sans-serif; color: rgb(41, 82, 24); background: rgb(247, 247, 247);\">(</span><em><span style=\"font-size: 9pt; line-height: 107%; font-family: Raleway; color: rgb(47, 77, 90); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span>Innovative solutions, delivered with\r\npassion</em><span style=\"font-size: 9pt; line-height: 107%; font-family: Tahoma, sans-serif; color: rgb(41, 82, 24); background: rgb(247, 247, 247);\">)</span></p>\r\n\r\n<table class=\"MsoTableGrid\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"1398\" style=\"width: 1048.5pt; margin-left: -49.75pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"714\" valign=\"top\" style=\"width:535.5pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n  text-align:justify;line-height:normal\"><span style=\"font-size:12.0pt;\r\n  font-family:&quot;Courier New&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n  color:#444444\">Mesh Technologies is a leading IT and Software development\r\n  service provider company based in Gilgit-Baltistan, established in the year\r\n  2022. We specialize in developing innovative and cutting-edge solutions for a\r\n  wide range of industries, including finance, healthcare, education,\r\n  e-commerce, and more.</span><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\n  mso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444\"><o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n  text-align:justify;line-height:normal\"><span style=\"font-size:12.0pt;\r\n  font-family:&quot;Courier New&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n  color:#444444\">Our team of highly skilled and experienced professionals is\r\n  committed to delivering high-quality and customized software solutions that\r\n  meet the unique requirements of our clients. With our expertise in the latest\r\n  technologies and frameworks, including Laravel PHP, React Native, Flutter,\r\n  Bootstrap, HTML, CSS, JavaScript, and jQuery, we are capable of building\r\n  robust and scalable applications that drive digital transformation and business\r\n  growth.</span><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\n  mso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444\"><o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n  text-align:justify;line-height:normal\"><span style=\"font-size:12.0pt;\r\n  font-family:&quot;Courier New&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n  color:#444444\">At Mesh Technologies, we follow industry best practices and\r\n  agile development methodologies to ensure efficient project management,\r\n  timely delivery, and exceptional customer service. We collaborate closely\r\n  with our clients to understand their business goals and objectives, and we\r\n  strive to exceed their expectations by delivering innovative solutions that\r\n  add value to their businesses.</span><span style=\"font-size:12.0pt;\r\n  font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n  color:#444444\"><o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n  text-align:justify;line-height:normal\"><span style=\"font-size:12.0pt;\r\n  font-family:&quot;Courier New&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n  color:#444444\">Our mission is to empower businesses with cutting-edge\r\n  technology solutions that enable them to stay competitive in today\'s rapidly\r\n  evolving digital landscape. Whether you need a web application, mobile app,\r\n  e-commerce platform, or custom software solution, we have the expertise and\r\n  experience to deliver reliable and cost-effective solutions that drive\r\n  results.</span><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\n  mso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444\"><o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n  text-align:justify;line-height:normal\"><span style=\"font-size:12.0pt;\r\n  font-family:&quot;Courier New&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n  color:#444444\">Partner with Mesh Technologies for all your IT and software\r\n  development needs and experience the difference of working with a trusted and\r\n  reliable technology partner. Contact us today to discuss your project\r\n  requirements and explore how we can help you achieve your business goals.</span></p><p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\n  text-align:justify;line-height:normal\"><span style=\"color: rgb(47, 77, 90); font-family: Raleway, sans-serif; text-align: center;\">Office # Office # B-118 Dar Plaza Gilgit, Gilgit-Baltistan</span><br style=\"color: rgb(47, 77, 90); font-family: Raleway, sans-serif; text-align: center;\"><span style=\"font-weight: bolder; color: rgb(47, 77, 90); font-family: Raleway, sans-serif; text-align: center;\">Phone:</span><span style=\"color: rgb(47, 77, 90); font-family: Raleway, sans-serif; text-align: center;\">&nbsp;03554228475</span><br style=\"color: rgb(47, 77, 90); font-family: Raleway, sans-serif; text-align: center;\"><span style=\"font-weight: bolder; color: rgb(47, 77, 90); font-family: Raleway, sans-serif; text-align: center;\">Mobile:</span><span style=\"color: rgb(47, 77, 90); font-family: Raleway, sans-serif; text-align: center;\">&nbsp;03554228475</span><br style=\"color: rgb(47, 77, 90); font-family: Raleway, sans-serif; text-align: center;\"><span style=\"font-weight: bolder; color: rgb(47, 77, 90); font-family: Raleway, sans-serif; text-align: center;\">Email:</span><span style=\"color: rgb(47, 77, 90); font-family: Raleway, sans-serif; text-align: center;\">&nbsp;info@meshtgb.com</span><span style=\"font-size:12.0pt;\r\n  font-family:&quot;Courier New&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\n  color:#444444\"><br></span><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n  &quot;Times New Roman&quot;;color:#444444\"><o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal\"><o:p>&nbsp;</o:p></p>\r\n  </td>\r\n  <td width=\"684\" valign=\"top\" style=\"width:513.0pt;border:solid windowtext 1.0pt;\r\n  border-left:none;mso-border-left-alt:solid windowtext .5pt;mso-border-alt:\r\n  solid windowtext .5pt;padding:0in 5.4pt 0in 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-outline-level:\r\n  2;vertical-align:baseline\"><span style=\"font-size:12.0pt;font-family:&quot;Courier New&quot;;\r\n  mso-fareast-font-family:&quot;Times New Roman&quot;\">The pioneering solution provider\r\n  in the field of Information Technology and services in Gilgit-Baltistan since\r\n  2005</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-outline-level:\r\n  2;vertical-align:baseline\"><span style=\"font-size:12.0pt;font-family:&quot;Courier New&quot;;\r\n  mso-fareast-font-family:&quot;Times New Roman&quot;\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal;mso-outline-level:\r\n  2;vertical-align:baseline\"><span style=\"font-weight: bolder; color: rgb(33, 37, 41); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14.4px; background-color: rgb(224, 224, 224);\">A&amp;Z Consultants GB.</span><br style=\"color: rgb(33, 37, 41); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14.4px; background-color: rgb(224, 224, 224);\"><span style=\"color: rgb(33, 37, 41); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14.4px; background-color: rgb(224, 224, 224);\">OfficeNo.7, 8, 9 &amp; 10 Dar Plaza</span><br style=\"color: rgb(33, 37, 41); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14.4px; background-color: rgb(224, 224, 224);\"><span style=\"color: rgb(33, 37, 41); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14.4px; background-color: rgb(224, 224, 224);\">Gilgit Balistan</span><br style=\"color: rgb(33, 37, 41); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14.4px; background-color: rgb(224, 224, 224);\"><span style=\"color: rgb(33, 37, 41); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 14.4px; background-color: rgb(224, 224, 224);\">Pakistan</span><span style=\"font-size:12.0pt;font-family:&quot;Courier New&quot;;\r\n  mso-fareast-font-family:&quot;Times New Roman&quot;\"><br></span><span style=\"font-size:12.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\n  mso-fareast-font-family:&quot;Times New Roman&quot;\"><o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0in;line-height:normal\"><o:p>&nbsp;</o:p></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"><span style=\"font-size: 9pt; line-height: 107%; font-family: Tahoma, sans-serif; color: rgb(41, 82, 24); background: rgb(247, 247, 247);\">\r\n\r\n\r\n\r\n</span></p>', 16, 'page_16.png', '', '', 1, '2023-09-11 05:39:37');
